import React from 'react';
import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';
import Context from './components/UI/store/Context';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Context.Provider><App /></Context.Provider>);
